import React from 'react';
import JobSearch from '../component/cari/jobSearch';
import ListJob from '../component/job/listJob';
import Navbar from '../component/navbar/navbar';

const Job = () => {
    return (
        <div>
            <Navbar/>
            <JobSearch/>
            <ListJob/>
        </div>
    );
}

export default Job;
